import {
    withGoogleMap,
    GoogleMap,
    Marker,
  } from "react-google-maps";

function Map(props) {

    const mapOptions = {
        disableDefaultUI: true
      };



    const MapWithAMarker = withGoogleMap(p =>


        <GoogleMap
          defaultZoom={10}
          defaultCenter={{ lat: props.pos["pos"][0], lng: props.pos["pos"][1]}}
          options={mapOptions}
        >
          <Marker
            position={{ lat: props.pos["pos"][0], lng: props.pos["pos"][1] }}
          />

          {passengers.length > 1 ? (
            <>{passengers.map((passenger) =>(
            <Marker
            position={{ lat: passenger.xy[0], lng: passenger.xy[1] }}
            />
            ))}</>
          ) : (
          <></>
          )}



        </GoogleMap>
      );



    return(
            <div className="map-wrapper-div">
                <>
                <MapWithAMarker
                    containerElement={<div style={{ height: `100%`}} />}
                    mapElement={<div className="map-div"/>}
                />
                </>
            </div>
    )
}

export default Map
